import React from 'react'
import {Link} from 'react-router-dom'
import logo from "../assets/Logo.svg"

const Navbar = () => {
    return(
        <div>
            <Link to="/"> <img alt="Not Found" src={logo} width="160" height={32} loading="lazy"></img> </Link>
        </div>
    )

}

export default Navbar;
